import { NavLink } from 'react-router-dom';

import Header from './Header';
import Footer from './Footer';

function MainNavigation() {
  return (
    <>
      <Header />
<li>
            <NavLink
              to="/"
              className={({ isActive }) =>
                isActive ? classes.active : undefined
              }
              end
            >
              Home
            </NavLink>
          </li>
      <Footer />
    </>
  );
}

export default MainNavigation;
